import React from 'react';

import './card1.scss';

type Props = JSX.IntrinsicElements['div'] & {
    title?: string;   
}

const Card1 : React.FC<Props> = ({
    title,
    ...rest
}) => { 
    return(
        <div className="card-1" {...rest}>

            <div className="card-1-bottom"></div>
        </div>
    );
}

export default Card1;
